byte[] utf8Bytes = null;
try {
    utf8Bytes = source.getBytes("UTF-8");
} catch (UnsupportedEncodingException e) {
    e.printStackTrace();
}
if( utf8Bytes != null ){
    return new String(utf8Bytes, Charset.forName("UTF-8"));
}

StringBuffer sb = new StringBuffer();
for(int i = 0; i < source.length(); i++) {
    char c = source.charAt(i);
    if( c == '"' || c == '\\') {
        sb.append('\\');
    }
    sb.append(c);
}
return sb.toString();

